('i017216', NULL, NULL, NULL, 0, NULL, NULL, NULL, NULL, 8923, NULL, NULL, 'soort: Streptomyces  Dit is de filamenteuze bodembacterie Streptomyces coelicolor. Het is een modelorganisme voor het bestuderen van ontwikkeling in bacteriele cellen.   Dit plaatje laat de karkateristieke luchthyfen zien die gevormd worden, en die uiteindelijke opsplitsen in ketens van sporen. Deze sporen groeien na verspreiding (door bijvoorbeeld wind of insecten) weer opnieuw uit.  Lange tijd dacht men dat Streptomyces een schimmel was, echter, het blijkt het bacterie te zijn.        ', NULL, '2008-05-23 11:37:16.883', NULL, NULL, NULL, '0FHCYFBLZJYU', NULL, 15544, '2008-05-23 11:37:23.523', 'Streptomyces coelicolor.jpg', NULL, NULL, 1),
