('i024031', NULL, NULL, NULL, 3, NULL, 102, NULL, 'planten', 15149, NULL, NULL, 'soort: Dactylorhiza fuchsii (Druce) Soó', 'Dactylorhiza maculata fuchsii', '2009-02-18 21:40:29.507', 'Leusden, Groot Zandbrink', NULL, 1, '17092', NULL, 24105, '2005-06-18 21:40:38.913', 'bosorchis (d. fuchsii of maculata) 2.jpg', 'dit zou mogelijk fuchsii kunnen zijn. Deze groep soorten staat echter bekend om zijn hydridenvorming en zijn veelvormigheid. het blijft voor een niet-specialist op Dactuylorhiza-gebied erg lastig. Raadpleeg ook anderen svp.    bij hjet vorige beeld (i026890) vergat ik op de goede knop te drukken en ik kan dan niet meer trerug. Ik bedoelde daar an te geven dat dat exemplaar er meer uitziet als D. majalis. Ook die doorsturen naar iemand als Oostermeijer.', NULL, NULL),
('i024032', NULL, NULL, NULL, 3, NULL, 102, NULL, 'planten', 15149, NULL, NULL, 'soort: Dactylorhiza fuchsii (Druce) Soó', 'Dactylorhiza maculata maculata', '2009-02-18 21:40:52.447', 'Leusden, Groot Zandbrink', NULL, 1, '17093', NULL, 24106, '2005-06-18 21:40:53.913', 'bosorchis (d. fuchsii of maculata) 3b.jpg', 'Gezien de structuur van de onderlip is dit veel meer een typische maculata dan fuchsii (beide ondersoorten van  D. maculata. Het gaat om een witte (afwijkende) vorm. Raadpleeg ook Oostermeijer, svp.', NULL, NULL),
