('i031343', NULL, NULL, NULL, 3, NULL, 11, NULL, 'waterbeesten', 20716, NULL, NULL, 'Physella acuta. Op naam gebracht met determinatietabel "De Nederlandse zoetwaterslakken" St. Jeugdbonds uitgeverij 3e ongewijzigde druk (1996). Volwassen, minimaal  3 maanden oud, 17 mm hoog, 9 mm breed. Gevonden in oktober in stilstaand, ondiep, poeltje. Linksgewonden huisje, top spits. Bij confrontatie met soortgenoot wordt er met huisje geschud. Rechterzijde mantel lijkt vingervormige aanhangsels te hebben (zie volgende foto).', NULL, '2010-01-31 17:35:00.653', 'Arnhem', NULL, 1, NULL, NULL, 39442, '2009-12-29 17:35:01.467', 'SNV32513c.jpg', NULL, NULL, NULL),
