('i036068', NULL, NULL, NULL, 3, NULL, 14, NULL, 'kevers', 21754, NULL, NULL, 'soort: Pityogenes chalcographus (L., 1761)    Paringskamers met hier tot 7 moedergangen per kamer. Vroeg ontwikkelingsstadium, moedergangen met eieren in nissen zichtbaar en moederdieren (slecht zichtbaar). Rozendaalse bos, Rozendaal, 11-05-2006.', NULL, '2010-07-23 12:00:10.623', 'Rozendaalse bos, Rozendaal (Gelderland)', NULL, 1, '0AHCYFBWLXCQ', NULL, 42214, '2010-07-23 12:00:22.733', 'Pit1.JPG', NULL, NULL, NULL),
('i036070', NULL, NULL, NULL, 3, NULL, 14, NULL, 'kevers', 21756, NULL, NULL, 'soort: Ips typographus (L., 1758)    Aantastingsbeeld. Paringskamer met twee moedergangen in aanleg op liggende fijnspar (bast verwijdert) centraal in beeld. Nog een moedergang zichtbaar, komend vanuit een aandere paringskamer (buiten beeld). Twee moederdieren nog aanwezig in de moedergangen en een derde adult los op de stam. Rozendaalse bos, Rozendaal, 11 mei 2006.', NULL, '2010-07-23 12:35:02.173', 'Rozendaalse bos, Rozendaal (Gelderland)', NULL, 1, '0AHCYFBWLIAM', NULL, 42216, '2006-05-11 12:35:04.157', 'Ips1.JPG', NULL, NULL, NULL),
('i036071', NULL, NULL, NULL, 3, NULL, 14, NULL, 'kevers', 21756, NULL, NULL, 'soort: Ips typographus (L., 1758)    Door letterzetter gedode fijnsparren (Picea abies) van onderen gefotografeerd, de belangrijkste gastboomsoort van deze kever. De onaangetatste grove den (Pinus sylvestris) op de foto, wordt bij uitzondering ook door deze kever als gastheer gebruikt. Osaby (Småland, Zweden) 26-09-2006.', NULL, '2010-07-23 12:35:06.597', 'Osaby, Småland', NULL, 1, '0AHCYFBWLIAM', NULL, 42217, '2006-09-26 12:35:08.347', 'Ips2.JPG', NULL, NULL, NULL),
('i036072', NULL, NULL, NULL, 3, NULL, 14, NULL, 'kevers', 21756, NULL, NULL, 'soort: Ips typographus (L., 1758)    Broedpatroon Letterzetter (Ips typographus) op stam van secundaire gastboomsoort Grove den (Pinus sylvestris). Osaby, Småland (Zweden) ', NULL, '2010-07-23 12:35:10.580', 'Osaby, Småland', NULL, 1, '0AHCYFBWLIAM', NULL, 42218, '2006-09-05 12:35:11.627', 'Ips3.JPG', NULL, NULL, NULL),
('i036073', NULL, NULL, NULL, 3, NULL, 14, NULL, 'kevers', 21756, NULL, NULL, 'soort: Ips typographus (L., 1758)    Broedpatroon Letterzetter (Ips typographus) op primaire gastboomsoort fijnspar (Picea abies). Osaby, Småland (Zweden) 05-09-2006.', NULL, '2010-07-23 12:35:20.190', 'Osaby, Småland', NULL, 1, '0AHCYFBWLIAM', NULL, 42219, '2006-09-05 12:35:21.720', 'Ips4.JPG', NULL, NULL, NULL),
('i036074', NULL, NULL, NULL, 3, NULL, 14, NULL, 'kevers', 21756, NULL, NULL, 'soort: Ips typographus (L., 1758)    Vraatpatroon Ips typographus in bast van secundaire gastheer Grove den (Pinus sylvestris). Het patroon van de moedergangen is grilliger en meer diffuus dan op Fijnspar (Picea abies). Deels omdat de moedergangen en larvgangen meer kronkelen, deels omdat de moedergangen gedeeltelijk verzonken zijn in de bast.', NULL, '2010-07-23 12:35:30.643', 'Osaby, Småland', NULL, 1, '0AHCYFBWLIAM', NULL, 42220, '2006-09-05 12:35:32.457', 'Ips5.JPG', NULL, NULL, NULL),
