('i064366', NULL, NULL, NULL, 4, 1, 147, NULL, 'schildluizen', 29691, NULL, NULL, 'Coccus hesperidum    op blad trompet plant', 'DISCUSSIE OVER DE NAAM LOOPT NOG zie mail 3-1-2012 14.24', '2011-12-05 18:05:00.297', 'Blaauwe Kamer, Wageningen', NULL, 1, NULL, NULL, 60110, '2011-11-01 18:05:00.847', 'Coccus hesperidum 1 11 2011.jpg', 'Ik zou de latijnse naam van de trompetplant willen weten, in de handel worden er meerdere planten onder die naam verkocht. Daarnaast zou ik willen weten of de vondst binnen (in of rond het restaurant met dezelfde naam)- of buiten is gevonden. Het zou Coccus hesperidum kunnen zijn maar de waarschijnlijkheid wordt groter als het rond het rond het restaurant is gevonden. Het beest is waarschijnlijk geparasiteerd. Mijn eerste impuls is dat het inderdaad om C. hesperidum gaat. Ik zou de vondst wel graag willen checken om te voorkomen dat het om een juveniel exemplaar van bijvoorbeeld Parthenolecanium corni gaat. ', 1, 1),
